import Card from "../Card/Card"
import "./CardsGrid.css"
import personajes from "../../data/personajes"

const CardsGrid = () => {
    return(
        <section>
            <div className="card-container">
            {personajes.map((personajes, idx)=>
                <Card key={idx}
                name={personajes.name} descripcion={personajes.des} img={personajes.img} id={personajes.id} mas={personajes.mas} extra={personajes.extra}/>
            )}
            </div>
        </section>

    )        
}
export default CardsGrid
